function App() {
  return (
    <>
    <input type='button'>
    <h1>Задание 1</h1>
      <Calendar />
      <h1>Задание 2</h1>
      <Table />
      <h1>Задание 3</h1>
      <Chess /> </input>
    </>
  );
}

export default App;
